%jdbc(hive)
drop table ajalloei.sbb;

create external table if not exists ajalloei.sbb(BETRIEBSTAG string, FAHRT_BEZEICHNER string, BETREIBER_ID string, BETREIBER_ABK string, BETREIBER_NAME string, PRODUKT_ID string, LINIEN_ID int, LINIEN_TEXT string, UMLAUF_ID string, VERKEHRSMITTEL_TEXT string, ZUSATZFAHRT_TF boolean, FAELLT_AUS_TF boolean, BPUIC string, HALTESTELLEN_NAME string, ANKUNFTSZEIT string, AN_PROGNOSE string, AN_PROGNOSE_STATUS string, ABFAHRTSZEIT string, AB_PROGNOSE string, AB_PROGNOSE_STATUS string, DURCHFAHRT_TF boolean)
    row format delimited fields terminated by ';'
    stored as textfile
    location '/datasets/sbb/'
    tblproperties ("skip.header.line.count"="1");

select * from ajalloei.sbb limit 10;

